from typing import Optional
def createList(nums):
    head = ListNode(nums[0])
    head2 = head
    for num in nums[1:]:
        head.next = ListNode(num)
        head = head.next
    return head2
# Definition for singly-linked list.
class ListNode:
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next
class Solution:
    def breakIntoTwoHalfs(self, head):
        slow, fast = head, head
        while fast.next:
            slow = slow.next
            fast = fast.next.next
        return head, slow
    def sortList(self, head: Optional[ListNode]) -> Optional[ListNode]:
        if not head or not head.next:
            return head
        head1, head2 = head, head.next
        while head1.next:
            head2 = head1.next
            while head2:
                if head1.val > head2.val:
                    head1.val, head2.val = head2.val, head1.val
                head2 = head2.next
            head1 = head1.next
        return head

head = createList([4,2,1,3,5])
head1, head2 = Solution().breakIntoTwoHalfs(head)
while head1:
    print(head1.val)
    head1 = head1.next
print()
while head2:
    print(head2.val)
    head2 = head2.next
